INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('4', '1', 'About Us', '&lt;p style=&quot;text-align: justify; &quot;&gt;&lt;b&gt;Shree Balaji Limited&lt;/b&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify; &quot;&gt;Since inception in 2004 in Accra Ghana, Shree Balaji has grown steadily and has progressively enhanced its business operations, functioning attentively on being an importer and exporter and a Supplier of Electronics and Home Appliances, in Ghana.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align: justify; &quot;&gt;Shree Balaji is fast emerging as the consumer electronics and home Appliances Company of choice in Ghana. The firm is distinct from competitors’ dealers that target the low, average Ghanaian and the middle income worker as against the prevailing general situation where Consumer Electronic dealers are developed extremely beyond the means of the average low or middle income salaried worker.&lt;/p&gt;&lt;p style=&quot;text-align: justify; &quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: justify; &quot;&gt;We are currently dealing in Air—Conditioners, LED Television, Home Theaters, &amp;nbsp;Fridges, Freezers, Microwaves, Washing Machines, Blenders, Rice-cookers, Gas cooker, Fans and many more with top brands such as Daewoo, Samsung, LG, Panasonic, Philips, Pearl, Midea, Nasco, and Chigo.&amp;nbsp;&lt;/p&gt;&lt;div style=&quot;text-align: justify; &quot;&gt;&lt;br&gt;&lt;/div&gt;\r\n', 'About Us', '', '');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('5', '1', 'Terms &amp; Conditions', '&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;Cookies :-\r\nThird parties may be placing or reading &quot;cookies&quot; on our web browser.\r\nCookies are alphanumeric identifiers that are transferred to your computer\'s\r\nhard drive through your web browser to enable its systems to recognize your\r\nbrowser. These cookies are persistent, identifying cookies that remember your\r\ninformation and link your activities to you. While you can take steps to warn\r\noff, block or disable these cookies, if you do, this website may not function\r\nand appear as it is designed. Nonetheless, if you want to take these steps, you\r\ncan do so by following the instructions associated with your browser. These\r\ncookies collect information such as the following:&lt;/span&gt;&lt;span style=&quot;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;color:#222222&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;1. the domain name and host from which you\r\naccess the Internet and the Internet address of the site from which you\r\ndirect-linked to ours;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;color:#222222&quot;&gt;&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;2. The date and time you access the website and\r\npages you visit;&lt;/span&gt;&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;your computer\'s IP address and information about\r\nits operating system, platform and the web browser type and version you use;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;&lt;span style=&quot;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin;color:#222222&quot;&gt;&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;3. Demographic and other non-personally\r\nidentifiable profile information about you; and&lt;/span&gt;&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;information to combat fraud or misuse&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n', 'Terms &amp; Conditions', '', '');
INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('3', '1', 'Privacy Policy', '&lt;p&gt;The operator of this website respects the intellectual property rights of others and has no bad faith intentions to &quot;cybersquat&quot; trademarks or confusingly similar business names. The domain name associated with this website is believed to be merely generic or descriptive in nature. The domain name is not for sale to any individual or company with trademark rights, or their agent, for the respective word or phrase. This domain name is also not for sale to any competitor of such trademark holder, or their agent. Any offer to sell a domain is immediately void.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The electronic or physical signature of the rights holder in the trademark or the person authorized to act on behalf of that person;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;i. Identification of the trademark or other right that you claim has been infringed;&lt;/p&gt;&lt;p&gt;ii. An identification of the specific domain name that is claimed to be infringing;&lt;/p&gt;&lt;p&gt;Your name, address, telephone number, and email address;&lt;/p&gt;&lt;p&gt;A statement by you that you have a good faith belief that the use of the domain name by the operator of this web site is not authorized by the trademark rights holder, its agent, or the law;&lt;/p&gt;&lt;p&gt;A statement that the information in your notice is accurate and a statement, made under penalty of perjury, that you are the rights holder or are authorized to act on the behalf of the rights holder; and&lt;/p&gt;&lt;p&gt;Any documents or information showing your exclusive rights to use the trademark claimed to be infringed (including, but not limited to, any government issued trademark documentation or any license agreements).&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;The operator of this web site may access, preserve and disclose to third parties any of your information or data (including personally identifiable information and private communications) related to a written notice of trademark infringement if it believes in its sole discretion that such access, preservation, or disclosure is necessary or useful to respond to or otherwise address such notice.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n', 'Privacy Policy', '', '');
