INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('1', 'Custom CSS Javascript Code', 'Custom CSS Javascript Code', 'Giang Nguyen mouse.nguyen2205@gmail.com', '2.2', '', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n    <name>Custom CSS Javascript Code</name>\r\n    <code>Custom CSS Javascript Code</code>\r\n    <version>2.2</version>\r\n\t<author><![CDATA[Giang Nguyen mouse.nguyen2205@gmail.com]]></author>\r\n\t<file path="catalog/controller/common/header.php">\r\n\t\t<operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t$data[\'title\'] = $this->document->getTitle();\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n\t\t\t$data[\'mousepanel\'] = $this->load->controller(\'common/mousepanel\');\r\n\t        ]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n    <file path="catalog/view/theme/*/template/common/header.tpl">\r\n\t\t<operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t</head>\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before"><![CDATA[\r\n\t\t\t<?php echo $mousepanel; ?>\r\n\t        ]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n</modification>', '1', '2016-10-10 15:31:07');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('2', 'Уменьшаем HTML', 'Speedhtml', 'Slait', '2.1.0.2', 'http://picasso-agency.ru', '<modification>\r\n\t<name>Уменьшаем HTML</name>\r\n\t<version>2.1.0.2</version>\r\n\t<link>http://picasso-agency.ru</link>\r\n\t<author>Slait</author>\r\n\t<code>Speedhtml</code>\r\n  \t<file path="system/library/response.php">        \r\n\t  <operation error="skip">\r\n\t      <search><![CDATA[$output = $this->compress($this->output, $this->level);]]></search>\r\n\t      <add position="replace"><![CDATA[ \r\n\t        $output = $this->compress(minify($this->output,1), $this->level);\r\n\t      ]]></add>\r\n\t  </operation> \r\n\t  <operation error="skip">\r\n\t      <search><![CDATA[$output = $this->output;]]></search>\r\n\t      <add position="replace"><![CDATA[ \r\n\t        $output = minify($this->output,1);\r\n\t      ]]></add>\r\n\t  </operation> \r\n\t  <operation error="skip">\r\n\t  \r\n\t  <search><![CDATA[echo $output;]]></search>\r\n\t  <add position="after" offset="3"><![CDATA[\r\n\r\ndefine(\'SAFE\', 1);\r\ndefine(\'EXTREME\', 2);\r\ndefine(\'EXTREME_SAVE_COMMENTS\', 4);\r\ndefine(\'EXTREME_SAVE_PRE\', 3);\r\n\r\nfunction minify($html, $level=2)\r\n{\r\n\tswitch((int)$level)\r\n\t{\r\n\t\tcase 0:\r\n\t\t\t//Не изменяем\r\n\t\tbreak;\r\n\t\t\r\n\t\tcase 1: //Стандартное изменение\r\n\t\t\r\n\t\t\t// Replace all whitespace characters between tags with a single space\r\n\t\t\t$html = preg_replace("`>\\s+<`", "> <", $html);\r\n\t\tbreak;\r\n\t\t\r\n\t\tcase 2: //Экстримально\r\n\t\t\t\r\n\t\t\t// Сохраняем все что в тегах <pre> и <code>\r\n\t\t\t$place_holders = array(\r\n\t\t\t\t\'<!-->\' => \'_!--_\',\r\n\t\t\t);\r\n\t\t\t\r\n\t\t\t//Заполняем\r\n\t\t\t$html = strtr($html, $place_holders);\r\n\t\t\t\r\n\t\t\t// Удаляем все комментарии\r\n\t\t\t$html = preg_replace(\'/<!--[^(\\[|(<!))](.*)-->/Uis\', \'\', $html);\r\n\t\t\t\r\n\t\t\t// Заменяем все символы пробела на один пробел\r\n\t\t\t$html = preg_replace("`\\s+`", " ", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробемы между тегами\r\n\t\t\t$html = preg_replace("`> <`", "><", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробелы между соседними тегами\r\n\t\t\t$html = str_replace("</a><a", "</a> <a", $html);\r\n\t\t\t\r\n\t\t\t// Восстанавливаем\r\n\t\t\t$html = strtr($html, array_flip($place_holders));\r\n\t\tbreak;\r\n\t\t\r\n\t\tcase 3: //Экстримально с сохранением pre и code\r\n\t\t\t// Сохраняем все что в тегах <pre> и <code>\r\n\t\t\t$place_holders = array(\r\n\t\t\t\t\'<!-->\' => \'_!--_\',\r\n\t\t\t\t\'<pre>\' => \'_pre_\',\r\n\t\t\t\t\'</pre>\' => \'_/pre_\',\r\n\t\t\t\t\'<code>\' => \'_code_\',\r\n\t\t\t\t\'</code>\' => \'_/code_\'\r\n\t\t\t);\r\n\t\t\t\r\n\t\t\t//Заполняем\r\n\t\t\t$html = strtr($html, $place_holders);\r\n\t\t\t\r\n\t\t\t// Удаляем все комментарии\r\n\t\t\t$html = preg_replace(\'/<!--[^(\\[|(<!))](.*)-->/Uis\', \'\', $html);\r\n\t\t\t\r\n\t\t\t// Заменяем все символы пробела на один пробел\r\n\t\t\t$html = preg_replace(">`\\s+`<", "> <", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробемы между тегами\r\n\t\t\t$html = preg_replace("`> <`", "><", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробелы между соседними тегами\r\n\t\t\t$html = str_replace("</a><a", "</a> <a", $html);\r\n\t\t\t\r\n\t\t\t$html = strtr($html, array_flip($place_holders));\r\n\t\t\r\n\t\tbreak;\r\n\t\t\r\n\t\tcase 4: //Экстримально\r\n\t\t\t\r\n\t\t\t// Заменяем все символы пробела на один пробел\r\n\t\t\t$html = preg_replace("`\\s+`", " ", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробемы между тегами\r\n\t\t\t$html = preg_replace("`> <`", "><", $html);\r\n\t\t\t\r\n\t\t\t// Удаляем пробелы между соседними тегами\r\n\t\t\t$html = str_replace("</a><a", "</a> <a", $html);\r\n\t\tbreak;\r\n\t}\r\n\r\n\t//Приводим & в вид\r\n\t//$html = str_replace("&amp;", "&", $html);\r\n\t//$html = str_replace("&", "&amp;", $html);\r\n\t\r\n\t//Заменяем символы\r\n\t$replace = array(\r\n\t\t\'&nbsp;\' => \'&#160;\',\r\n\t\t\'&copy;\' => \'&#169;\',\r\n\t\t\'&acirc;\' => \'&#226;\',\r\n\t\t\'&cent;\' => \'&#162;\',\r\n\t\t\'&raquo;\' => \'&#187;\',\r\n\t\t\'&laquo;\' => \'&#171;\'\r\n\t);\r\n\t\r\n\t//$html = strtr($html, $replace);\r\n\t\r\n\t//Возвращаем HTML\r\n\treturn $html;\r\n}\t\t]]></add>\r\n\t  </operation> \r\n\t</file>\r\n</modification>', '1', '2016-10-10 15:32:32');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('3', 'Super Custom Theme', 'Super Custom Theme', 'Giang Nguyen mouse.nguyen2205@gmail.com', '2.2', '', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n    <name>Super Custom Theme</name>\r\n    <code>Super Custom Theme</code>\r\n    <version>2.2</version>\r\n\t<author><![CDATA[Giang Nguyen mouse.nguyen2205@gmail.com]]></author>\r\n\t<file path="catalog/controller/common/header.php">\r\n\t\t<operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t$data[\'title\'] = $this->document->getTitle();\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n\t\t\t$data[\'mousepanel\'] = $this->load->controller(\'common/mousepanel\');\r\n\t        ]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n    <file path="catalog/view/theme/*/template/common/header.tpl">\r\n\t\t<operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t</head>\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before"><![CDATA[\r\n\t\t\t<?php echo $mousepanel; ?>\r\n\t        ]]></add>\r\n\t\t</operation>\r\n\t</file>\r\n</modification>', '1', '2016-10-10 15:33:36');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('4', '<font color="#0000"><b>Welcome Client Account</font>', 'ManuellaWCA', '<font color="#CC0000"><b>Leandro R.P.P.O</font>', '<b>1.0</b>', 'http://www.swad.com.br', '<modification>\r\n   <name><![CDATA[<font color="#0000"><b>Welcome Client Account</font>]]></name>\r\n   <code>ManuellaWCA</code>\r\n    <version><![CDATA[<b>1.0</b>]]></version>\r\n    <author><![CDATA[<font color="#CC0000"><b>Leandro R.P.P.O</font>]]></author>\r\n    <link><![CDATA[http://www.swad.com.br]]></link>\r\n <!-- Config Language -->\r\n <file path="catalog/language/en-gb/account/account.php">\r\n    <operation>\r\n\t\t\t<search><![CDATA[\r\n            <?php\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n            $_[\'text_lrppo\']  = \'Hi <strong>%s</strong>, welcome!\';\r\n      ]]></add>\r\n\t</operation>\r\n</file>\r\n <file path="catalog/language/pt-br/account/account.php">\r\n    <operation>\r\n\t\t\t<search><![CDATA[\r\n            <?php\r\n\t\t\t]]></search>\r\n\t\t\t<add  position="after"><![CDATA[\r\n            $_[\'text_lrppo\']  = \'Olá <strong>%s</strong>, bem-vindo(a) à nossa loja!\';\r\n            ]]></add>\r\n\t</operation>\r\n</file>\r\n <!-- End Language -->   \r\n<file path="catalog/controller/account/account.php">\r\n    <operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t$data[\'newsletter\'] = $this->url->link(\'account/newsletter\', \'\', true);\r\n\t\t\t]]></search>\r\n\t\t\t<add position="after"><![CDATA[\r\n\t\t    $this->load->model(\'account/customer\');\r\n\t\t    $customer_info = $this->model_account_customer->getCustomer($this->customer->getId());\r\n\t\t    $data[\'text_lrppo\'] = sprintf($this->language->get(\'text_lrppo\'), $customer_info[\'firstname\']);\r\n      ]]></add>\r\n\t</operation>\r\n</file>\t\t\t\r\n<file path="catalog/view/theme/*/template/account/account.tpl">\r\n    <operation>\r\n\t\t\t<search><![CDATA[\r\n\t\t\t<h2><?php echo $text_my_account; ?></h2>\r\n\t\t\t]]></search>\r\n\t\t\t<add position="before"><![CDATA[\r\n            <br /><h2><?php echo $text_lrppo; ?></h2><br />\t\r\n           ]]></add>\r\n\t</operation>\r\n</file>\t\r\n</modification>', '1', '2016-10-15 05:59:26');
INSERT INTO `oc_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES ('5', 'Current Password Confirmation', 'Current Password Confirmation', 'Smart Web Players', '2x', '', '<?xml version="1.0" encoding="UTF-8"?>\n<modification>\n\t<name>Current Password Confirmation</name>\n\t<version>2x</version>\n\t<code>Current Password Confirmation</code>\n\t<author>Smart Web Players</author>\n\t<!--ADMIN STARTS-->\n\t<file path="catalog/view/theme/*/template/account/password.tpl">\n\t\t<operation>\n\t\t\t<search><![CDATA[<legend><?php echo $text_password; ?></legend>]]></search>\n\t\t\t<add position="after"><![CDATA[\n\t\t\t\n\t\t\t\t\t<!-- /* Starts */ -->\n          <div class="form-group required">\n            <label class="col-sm-2 control-label" for="input-current"><?php echo $entry_current; ?></label>\n            <div class="col-sm-10">\n              <input type="password" name="current" value="<?php echo $current; ?>" placeholder="<?php echo $entry_current; ?>" id="input-current" class="form-control" />\n              <?php if ($error_current) { ?>\n              <div class="text-danger"><?php echo $error_current; ?></div>\n              <?php } ?>\n            </div>\n          </div>\n\t\t\t\t\t<!-- /* Ends */ -->\n\t\t\t\t\t\n\t\t]]></add>\n\t\t</operation>\n\t</file>\n\t<file path="catalog/controller/account/password.php">\n\t\t<operation>\n\t\t\t<search><![CDATA[$data[\'button_back\'] = $this->language->get(\'button_back\');]]></search>\n\t\t\t<add position="after"><![CDATA[\n\t\t\t\n\t\t/* Starts */\n\t\t$data[\'entry_current\'] = $this->language->get(\'entry_current\');\n\t\tif (isset($this->error[\'current\'])) {\n\t\t\t$data[\'error_current\'] = $this->error[\'current\'];\n\t\t} else {\n\t\t\t$data[\'error_current\'] = \'\';\n\t\t}\n\t\t\n\t\tif (isset($this->request->post[\'current\'])) {\n\t\t\t$data[\'current\'] = $this->request->post[\'current\'];\n\t\t} else {\n\t\t\t$data[\'current\'] = \'\';\n\t\t}\n\t\t/* Ends */\n\t\t\n\t\t]]></add>\n\t\t</operation>\n\t\t<operation>\n\t\t\t<search><![CDATA[validate() {]]></search>\n\t\t\t<add position="after"><![CDATA[\n\t\t\t\n\t\t/* Starts */\n\t\tif (isset($this->request->post[\'current\'])) {\n\t\t\t$this->load->model(\'account/customer\');\n\t\t\t$customer_info = $this->model_account_customer->getCustomerByCorrectEmailPassword($this->customer->getEmail(), $this->request->post[\'current\']);\n\t\t\tif(!$customer_info) {\n\t\t\t\t$this->error[\'current\'] = $this->language->get(\'error_current\');\n\t\t\t}\n\t\t}\n\t\t/* Ends */\n\t\t\n\t\t]]></add>\n\t\t</operation>\n\t</file>\n\t<file path="catalog/language/*/account/password.php">\n\t\t<operation>\n\t\t\t<search><![CDATA[// Entry]]></search>\n\t\t\t<add position="before"><![CDATA[\n\t\t\t\t\n/* Starts */\n$_[\'entry_current\']\t = \'Current Password\';\n$_[\'error_current\']  = \'Current Password does not match!\';\n/* Ends */\n\n\t\t]]></add>\n\t\t</operation>\n\t</file>\n\t<file path="catalog/model/account/customer.php">\n\t\t<operation>\n\t\t\t<search><![CDATA[public function getTotalCustomersByEmail($email) {]]></search>\n\t\t\t<add position="before"><![CDATA[\n\t\t\t\n\t/* Starts */\n\tpublic function getCustomerByCorrectEmailPassword($email, $password) {\n\t\t$customer_query = $this->db->query("SELECT * FROM " . DB_PREFIX . "customer WHERE LOWER(email) = \'" . $this->db->escape(utf8_strtolower($email)) . "\' AND (password = SHA1(CONCAT(salt, SHA1(CONCAT(salt, SHA1(\'" . $this->db->escape($password) . "\'))))) OR password = \'" . $this->db->escape(md5($password)) . "\')");\n\t\t\n\t\treturn $customer_query->num_rows;\n\t}\n\t/* Ends */\n\n\t\t]]></add>\n\t\t</operation>\n\t</file>\n</modification>', '1', '2016-10-16 22:33:45');
